import { REQUEST_WALLET, REQUEST_API, REQUEST_API_SUCCESS,
  REQUEST_API_ERROR } from '../actions';

const INNITIAL_STATE = {
  currencies: [],
  expenses: [],
};

const wallet = (state = INNITIAL_STATE, action) => {
  switch (action.type) {
  case REQUEST_WALLET:
    return { ...state, wallet: action.payload };
  default:
    return state;
  }
};

export default wallet;
